import React from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Home from './components/pages/Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Services from './components/pages/Services';
import Products from './components/pages/Products';
import SignUp from './components/pages/SignUp';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <Route path='/' exact component={Home} />
          <Route path='/me' component={Services} />
          <Route path='/climb' component={Services} />
          <Route path='/hike' component={Products} />
          <Route path='/ski' component={Services} />
          <Route path='/code' component={Products} />
          <Route path='/cook' component={Products} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
